import './App.css';
import React from 'react'
import Bio from './components/Bio';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/bio' element={<Bio/>}/>
        <Route path='*' element={<Bio/>}/>
      </Routes>

      <h1>Pablo Pi</h1>
    </div>
  );
}

export default App;
